import React, { useEffect, useRef } from 'react';
import PropTypes from 'prop-types';
import { Avatar, Col, List, Row, Space } from 'antd';
import { API_KEY } from '../../constants/api-keys';
import LazyLoadImg from '../LazyLoadImg/LazyLoadImg';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	const imgurl = API_KEY.IMAGE_URL;

	const list = [
		'https://image.tmdb.org/t/p/w500/6DrHO1jr3qVrViUO6s6kFiAGM7.jpg',
		'https://image.tmdb.org/t/p/w500/4Q1n3TwieoULnuaztu9aFjqHDTI.jpg',
		'https://image.tmdb.org/t/p/w500/74xTEgt7R36Fpooo50r9T25onhq.jpg',
		'https://image.tmdb.org/t/p/w500/62HCnUTziyWcpDaBO2i1DX17ljH.jpg',
	];

	return (
		<Row>
			{/* {current?.map((movie) => (
				<div key={movie.id}>
				</div>
			))} */}
			{list.map((x) => (
				<LazyLoadImg url={x} />
			))}
		</Row>
	);
}

export default ListViewTest;
